export default function Thumbnail({ src, title, alt, h, w }) {
    if (alt === undefined) {
        alt = "Video thumbnail"
    }
    if (h === undefined) {
        h = "48"
    }
    if (w === undefined) {
        w = "96"
    }

    return (

        <div className={"col-sm visible"}>

            <img className={`object-cover h-${h} w-${w} bg-gray-100`} src={src} alt={alt} />
            <h className="text-white text-base font-bold italic">{title}</h>
        </div>
    )
}
